    this.onChangeDescription = this.onChangeDescription.bind(this);
    this.onSubmit = this.onSubmit.bind(this);

    this.state = {
      category: " ",
      description: " ",
    };
  }
  componentDidMount() {
    axios
      .get("http://localhost:5000/notes/632fffefc51f9e0a6efbff32")
      .then((response) => {
        // this.setState({ notes: response.data });
